import React from 'react'

class SearchShablon extends React.Component{
    render(){
        return(
            <div className = "groupbtn">
                <input id = "InPassword" placeholder = {"Введите пароль"}></input>
                <button id ="LoginButton" onClick={this.gotocreate}>
                    <img src={this.props.image} alt="search"></img>
                </button>
            </div>
        )
    }
    gotocreate () {
        console.log("Create");
    }
}

export default SearchShablon
